func cntData(data map[string][][][]int) {
	for key := range data {
		m := map[string][][][]int{}
		m2 := map[string][][][]int{}
		for k := range data[key] {
			keyStr := fmt.Sprintf("%d%d%d%d%d%d", data[key][k][0][1], data[key][k][0][2], data[key][k][1][1], data[key][k][1][2], data[key][k][2][1], data[key][k][2][2])
			if _, ok := m[keyStr]; !ok {
				m[keyStr] = append(m[keyStr], data[key][k])
			} else {
				m[keyStr] = append(m[keyStr], data[key][k])
			}

			keyStr2 := fmt.Sprintf("%d%d%d%d%d%d", data[key][k][1][0], data[key][k][1][1], data[key][k][1][2], data[key][k][2][0], data[key][k][2][1], data[key][k][2][2])
			if _, ok := m2[keyStr2]; !ok {
				m2[keyStr2] = append(m2[keyStr2], data[key][k])
			} else {
				m2[keyStr2] = append(m2[keyStr2], data[key][k])
			}
		}
		fmt.Printf("v%+v %+v\n", key, m)
		// fmt.Printf("h%+v %+v\n", key, m2)
	}
}

